import "./About";

const About = () => {
  return (
    <div className="container">
      <div className="image-stack">
        <div className="image-stack__item--top">
          <img src="path_to_image_1.jpg" alt="Image 1" />
        </div>
        <div className="image-stack__item--bottom">
          <img src="path_to_image_2.jpg" alt="Image 2" />
        </div>
      </div>
      <div className="text-column">
        <h1>Little Lemon</h1>
        <h2>Chicago</h2>
        <p>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Proin eget
          nulla magna. Phasellus sodales enim ut lorem vestibulum luctus. Fusce
          ullamcorper scelerisque mi, a lobortis lacus efficitur sed.
        </p>
      </div>
    </div>
  );
};

export default About;
